import  React from 'react';
import { DataGrid } from '@mui/x-data-grid';
import { Stack } from '@mui/system';
import { Button } from '@mui/material';

const columns = [
  { field: 'id', headerName: 'ID', width: 70 },
  { field: 'Name', headerName: 'Name', width: 130 },
  {
    field: 'gender',
    headerName: 'Gender',
    type: 'string',
    width: 90,
  }, {
    field: 'city',
    headerName: 'City',
    type: 'string',
    width: 90,
  },{
    field: "action",
    headerName: "Action",
    sortable: false,
    renderCell: ({ row }) =>
      <Button variant='contained' color='primary' onClick={() => {
        console.log(row);
      }}>
        Edit 
      </Button>,
  }
];

const rows = [
  { id: 1, Name: 'umer', gender: 'm', city:'islamabad' , 

  } ,
  { id: 2, Name: 'Ali', gender: 'm', city:'wah cantt' },

];


export default function DataTable() {
  return (
    <Stack direction={"row"} spacing={'10px'} marginLeft={'30%'} marginRight={'30%'} marginTop={'20px'}>
      <DataGrid
        rows={rows}
        columns={columns}

        pagination={false}
        hideFooterPagination={true}
      /></Stack>
  );
}
